class Solution:
    def canJump(self, nums: List[int]) -> bool:
        # Initialize maxReach which stores the maximum index we can reach
        maxReach = 0
        n = len(nums)

        # Iterate through each index of the array
        for i in range(n):
            # If the current index is greater than maxReach, it means we can't reach index i, hence return False
            if i > maxReach:
                return False

            # Update maxReach with the maximum of itself or the new reach index from the current position
            maxReach = max(maxReach, i + nums[i])

            # If maxReach is already enough to reach the last index, return True
            if maxReach >= n - 1:
                return True

        # Final check if maxReach can reach the last index
        return maxReach >= n - 1
